    static class HasCharElementPolicy implements org.owasp.html.ElementPolicy {
        final char ch;

        HasCharElementPolicy(char ch) {
            this.ch = ch;
        }

        @javax.annotation.Nullable
        public java.lang.String apply(java.lang.String elementName, java.util.List<java.lang.String> attrs) {
            attrs.clear();
            return (elementName.indexOf(ch)) >= 0 ? elementName : null;
        }

        @java.lang.Override
        public java.lang.String toString() {
            return ("(has '" + (ch)) + "')";
        }
    }

